app1.controller("FileCtrl",["$scope","$routeParams","$location","SessionService",function(e,t,a,n){e.sessionData=n.getSessionData();var i=function(){if("undefined"==t.iframe_file||"undefined"==t.application_id)a.url("/applications");else{if(e.sessionData.application_id=t.application_id,e.sessionData.applications){for(var i=e.sessionData.applications,r=0;r<i.length;r++)if(i[r].translated_name=n.translate(i[r].name),i[r].translated_description=n.translate(i[r].description),i[r]._id==t.application_id){e.sessionData.applicationName=i[r].translated_name;break}n.setSessionData(e.sessionData)}document.getElementById("iframe_file").src="https://docs.google.com/viewer?url=https://app1.cloud/file/"+t.iframe_file+"&embedded=true"}};e.$watch(function(){return n.getSessionData().applications},function(t,a){t!=a&&(e.sessionData=n.getSessionData(),i())}),i()}]);
